const githubData = $input.first().json;
const currentContent = Buffer.from(githubData.content, 'base64').toString('utf8');
let recipes = [];
try { recipes = JSON.parse(currentContent); if (!Array.isArray(recipes)) recipes = []; } catch(e) { recipes = []; }

const existingSlugs = recipes.map(r => r.slug).filter(Boolean);
const existingTitles = recipes.map(r => r.title).filter(Boolean);

return [{ json: { existingSlugs, existingTitles, totalExisting: recipes.length } }];

const raw = $input.first().json.choices?.[0]?.message?.content || '';
const cleaned = raw.replace(/```json\n?/g, '').replace(/```\n?/g, '').trim();

let recipe;
try {
    recipe = JSON.parse(cleaned);
} catch(e) {
    throw new Error('JSON invalido de Grok: ' + e.message + ' | Inicio: ' + cleaned.slice(0, 200));
}

if (!recipe.title || !recipe.slug) {
    throw new Error('Faltan campos requeridos title/slug: ' + JSON.stringify(recipe).slice(0, 200));
}

if ((recipe.description || '').length < 80) {
    throw new Error('Description demasiado corta (' + (recipe.description || '').length + ' chars): ' + recipe.description);
}

// Normalize slug
recipe.slug = recipe.slug.toLowerCase().trim()
  .replace(/[\u00e1\u00e0\u00e4\u00e2]/g, 'a')
  .replace(/[\u00e9\u00e8\u00eb\u00ea]/g, 'e')
  .replace(/[\u00ed\u00ec\u00ef\u00ee]/g, 'i')
  .replace(/[\u00f3\u00f2\u00f6\u00f4]/g, 'o')
  .replace(/[\u00fa\u00f9\u00fc\u00fb]/g, 'u')
  .replace(/\u00f1/g, 'n')
  .replace(/[^a-z0-9-]/g, '-')
  .replace(/-+/g, '-')
  .replace(/^-|-$/g, '');

// NORMALIZATION: Convert ingredients from object to string
if (Array.isArray(recipe.ingredients)) {
    recipe.ingredients = recipe.ingredients.map(ing => {
          if (typeof ing === 'object' && ing !== null) {
                  let str = ing.name || '';
                  if (ing.quantity) str = `${ing.quantity} ${str}`;
                  if (ing.where_to_buy) str = `${str} (comprar en ${ing.where_to_buy})`;
                  return str.trim();
          }
          return ing;
    });
}

// NORMALIZATION: Convert FAQs from question/answer to q/a
if (Array.isArray(recipe.faqs)) {
    recipe.faqs = recipe.faqs.map(faq => {
          if (faq && (faq.question || faq.answer)) {
                  return {
                            q: faq.question || faq.q || '',
                            a: faq.answer || faq.a || ''
                  };
          }
          return faq;
    });
}

// Guarantee v3 fields
if (!recipe.origin_cities) recipe.origin_cities = [];
if (!recipe.youtube_query) recipe.youtube_query = recipe.title + ' receta ecuatoriana';
if (!recipe.image_keywords) recipe.image_keywords = [recipe.title, 'ecuadorian food', 'traditional dish'];
if (!recipe.image_alt) recipe.image_alt = recipe.title + ', plato tipico ecuatoriano';

return {
    json: recipe
};

const ytValidated = $input.first().json;
const items = ytValidated.items || [];

// Filtrar solo embeddable
const embeddable = items.filter(item => item.status && item.status.embeddable !== false);

const youtube_videos = embeddable.slice(0, 3).map(item => ({
  title: item.snippet?.title || '',
  videoId: item.id,
  channel: item.snippet?.channelTitle || '',
  url: 'https://www.youtube.com/watch?v=' + item.id,
  embed: 'https://www.youtube-nocookie.com/embed/' + item.id,
  uploadDate: (item.snippet?.publishedAt || '').split('T')[0] || undefined,
  description: (item.snippet?.description || '').slice(0, 200)
}));

return [{ json: { youtube_videos } }];

// Extrae de Parsear Receta JSON o Parsear Post JSON dependiendo del workflow
let recipe = {};
try { recipe = $('Parsear Receta JSON').first().json; } catch(e) {}
if (!recipe.slug) {
  try { recipe = $('Parsear Post JSON').first().json; } catch(e) {}
}

let youtubeData = {};
try { youtubeData = $('Procesar Videos YouTube').first().json; } catch(e) {}

const enriched = Object.assign({}, recipe);

//  YouTube videos 
if (youtubeData.youtube_videos && youtubeData.youtube_videos.length > 0) {
  enriched.youtube_videos = youtubeData.youtube_videos;
}

//  Imagen Web extraida 
let aiData = {};
try { aiData = $('Generar Imagen IA').first().json; } catch(e) {}

if (aiData.ai_image_url && aiData._imagen3_status === 'ok') {
  enriched.image_url = aiData.ai_image_url;
  enriched._image_source = aiData._image_source || 'web_search';
  if (aiData._image_source_url) {
      enriched._image_source_url = aiData._image_source_url;
  }
} else {
  // Si busqueda fall
  if (!enriched.image_url) {
    console.warn('Imagen web no disponible. image_url = null');
    enriched._image_source = 'pending';
  }
}

// Asegurar que image_alt es correcto
if (!enriched.image_alt || enriched.image_alt.toLowerCase().includes('chef')) {
  enriched.image_alt = `Fotografa de: ${enriched.title}  gastronoma y turismo en Ecuador`;
}

delete enriched.youtube_query;
return [{ json: enriched }];

const recipe = $input.first().json;
const errors = [];

// Campos obligatorios
if (!recipe.slug || recipe.slug.length < 3) errors.push('slug invlido: ' + recipe.slug);
if (!recipe.title || recipe.title.length < 5) errors.push('title muy corto: ' + recipe.title);
if (!recipe.description || recipe.description.length < 80) errors.push('description < 80 chars: ' + (recipe.description || '').length + ' chars');

// Contenido mnimo
if (!recipe.ingredients || recipe.ingredients.length < 8) errors.push('ingredientes < 8: ' + (recipe.ingredients || []).length);
if (!recipe.instructions || recipe.instructions.length < 6) errors.push('instrucciones < 6: ' + (recipe.instructions || []).length);

// Videos (aviso, no bloquea)
const hasVideos = recipe.youtube_videos && recipe.youtube_videos.length > 0;
if (!hasVideos) {
  console.warn('Receta sin videos YouTube  se publica igual');
}

if (errors.length > 0) {
  throw new Error('QUALITY_GATE_FAILED: ' + errors.join(' | '));
}

console.log('Quality Gate OK:', recipe.slug, '| videos:', (recipe.youtube_videos || []).length);
return [{ json: recipe }];

const newRecipe = $('Quality Gate').first().json;
const githubData = $input.first().json;
const fileSha = githubData.sha;

const currentContent = Buffer.from(githubData.content, 'base64').toString('utf8');
let recipes = [];
try {
  recipes = JSON.parse(currentContent);
  if (!Array.isArray(recipes)) recipes = [];
} catch(e) { recipes = []; }

// Dedup por slug
if (recipes.some(r => r.slug === newRecipe.slug)) {
  throw new Error('DUPLICADO_SLUG: ' + newRecipe.slug);
}

// Auto-increment ID
const maxId = recipes.reduce((max, r) => Math.max(max, Number(r.id) || 0), 0);
newRecipe.id = maxId + 1;
newRecipe.created_at = new Date().toISOString();

// Prepend (ms reciente primero)
recipes.unshift(newRecipe);

const newContent = Buffer.from(JSON.stringify(recipes, null, 2), 'utf8').toString('base64');
const hasPlaces = (newRecipe.places || []).length;
const hasVideos = (newRecipe.youtube_videos || []).length;
const extras = [hasPlaces ? hasPlaces + ' lugares' : '', hasVideos ? hasVideos + ' videos' : ''].filter(Boolean).join(', ');

return [{ json: {
  sha: fileSha,
  content: newContent,
  slug: newRecipe.slug,
  title: newRecipe.title,
  id: newRecipe.id,
  total: recipes.length,
  extras: extras || 'sin enriquecimiento'
} }];

//  Extraer imagen real va Google Custom Search (Reemplaza Unsplash / HuggingFace) 
// Extrae de Parsear Receta JSON o Parsear Post JSON dependiendo del workflow
let recipe = {};
try { recipe = $('Parsear Receta JSON').first().json; } catch(e) {}
if (!recipe.slug) {
  try { recipe = $('Parsear Post JSON').first().json; } catch(e) {}
}

const GH_TOKEN = $env.GITHUB_TOKEN;
const REPO     = 'LordRa2pat/recetas-ecuador';

const GOOGLE_API_KEY = $env.GOOGLE_SEARCH_API_KEY; 
const GOOGLE_CX = $env.GOOGLE_CX;

// 1. Buscar imagen en Google
let queryConcept = recipe.title;
if (recipe.image_keywords && Array.isArray(recipe.image_keywords) && recipe.image_keywords.length > 0) {
    queryConcept = recipe.image_keywords[0];
}
const query = encodeURIComponent(`${queryConcept} plato tipico comida ecuatoriana`);
const searchUrl = `https://www.googleapis.com/customsearch/v1?q=${query}&searchType=image&cx=${GOOGLE_CX}&key=${GOOGLE_API_KEY}&num=1`;

let sourceUrl = '';
let imageUrl = '';

try {
  const searchResp = await fetch(searchUrl);
  if (searchResp.ok) {
    const searchData = await searchResp.json();
    if (searchData.items && searchData.items.length > 0) {
      imageUrl = searchData.items[0].link;
      sourceUrl = searchData.items[0].image.contextLink;
      console.log('Google Image found:', imageUrl, 'Source:', sourceUrl);
    }
  } else {
    console.error('Google Search Error:', await searchResp.text());
  }
} catch (e) {
  console.error('Google Search Exception:', e.message);
}

if (!imageUrl) {
  console.warn('Image not found via API, falling back to local flow');
  return [{ json: { ...recipe, _imagen_status: 'failed' } }];
}

// 2. Descargar imagen
let imageBuffer = null;
try {
  const imgResp = await fetch(imageUrl, { signal: AbortSignal.timeout(30000) });
  if (imgResp.ok) {
    imageBuffer = Buffer.from(await imgResp.arrayBuffer());
  }
} catch (e) {
  console.error('Download Image Exception:', e.message);
  return [{ json: { ...recipe, _imagen_status: 'download_failed' } }];
}

if (!imageBuffer) {
  return [{ json: { ...recipe, _imagen_status: 'download_failed' } }];
}
const b64Image = imageBuffer.toString('base64');

// 3. Normalizar slug para archivo
const slug = (recipe.slug || recipe.title)
  .toLowerCase()
  .replace(/[]/g, 'a').replace(/[]/g, 'e')
  .replace(/[]/g, 'i').replace(/[]/g, 'o')
  .replace(/[]/g, 'u').replace(/[]/g, 'n')
  .replace(/\s+/g, '-').replace(/[^a-z0-9-]/g, '').replace(/-+/g, '-')
  .replace(/^-|-$/g, '');

const ghPath = `images/${slug}.jpg`;

// 4. Subir a GitHub
let existingSha = null;
try {
  const checkResp = await fetch(`https://api.github.com/repos/${REPO}/contents/${ghPath}`, {
    headers: { 'Authorization': `token ${GH_TOKEN}`, 'Accept': 'application/vnd.github.v3+json' }
  });
  if (checkResp.ok) existingSha = (await checkResp.json()).sha;
} catch (e) {}

const uploadBody = {
  message: `feat(img-web): source ${sourceUrl}`,
  content: b64Image,
  ...(existingSha ? { sha: existingSha } : {})
};

try {
  const uploadResp = await fetch(`https://api.github.com/repos/${REPO}/contents/${ghPath}`, {
    method: 'PUT',
    headers: { 'Authorization': `token ${GH_TOKEN}`, 'Content-Type': 'application/json', 'Accept': 'application/vnd.github.v3+json' },
    body: JSON.stringify(uploadBody)
  });
  if (uploadResp.ok) {
    const rawUrl = `https://raw.githubusercontent.com/${REPO}/main/${ghPath}`;
    return [{ json: { ...recipe, ai_image_url: rawUrl, _imagen3_status: 'ok', _image_source_url: sourceUrl, _image_source: 'web_search' } }];
  }
} catch (e) {
  console.error('GH Upload Error:', e.message);
}
return [{ json: { ...recipe, _imagen_status: 'upload_failed' } }];

// Validation Gate  recipes.json
const item = $input.first().json;
const decoded = Buffer.from(item.content, 'base64').toString('utf8');
let arr;
try { arr = JSON.parse(decoded); } catch(e) { throw new Error('JSON invlido: ' + e.message); }
if (!Array.isArray(arr) || arr.length === 0) throw new Error('recipes.json vaco o no es array');
const seen = new Set(); const dups = [];
arr.forEach(function(r) { if (seen.has(r.slug)) dups.push(r.slug); seen.add(r.slug); });
if (dups.length) throw new Error('slugs duplicados: ' + dups.join(', '));
const r = arr[0];
if (!r.slug || !String(r.slug).trim()) throw new Error('slug vaco en nueva receta');
if (!r.description || r.description.length < 80) throw new Error('description < 80 chars: ' + r.slug);
if (!Array.isArray(r.ingredients) || r.ingredients.length < 4) throw new Error('ingredients insuficientes: ' + r.slug);
if (!Array.isArray(r.instructions) || r.instructions.length < 3) throw new Error('instructions insuficientes: ' + r.slug);
console.log('VALIDATE OK: ' + arr.length + ' recetas  nueva: ' + r.slug);
return [{ json: item }];
